import React from "react";

interface IProps {
  showModal: (modal: boolean) => void;
}

const Landing: React.FunctionComponent<IProps> = ({ showModal }) => {
  return (
    <div>
      <form>
        <label>Player Name</label>
        <input type="text" />
        <button onClick={showModal(false)} />
      </form>
    </div>
  );
};

export default Landing;
